import React from 'react';
import FeatherIcon from 'feather-icons-react';
import './style.scss';
import sidebarData from '../../../data/leftSidebar.json';

interface Badge {
    type?: string;
    value?: string;
    visible?: boolean;
    class?: string;
  }

  interface SidebarItem {
    name: string;
    icon: string;
    url: string;
    toggle: boolean;
    badge: Badge;
    arrow: boolean;
    submenu: SidebarItem[];
  }

  interface SidebarSection {
    parent: string;
    menu: SidebarItem[];
  }

  interface SidebarProps {
    sidebarData: SidebarSection[];
  }

  const SidebarMenu: React.FC<SidebarProps> = ({ sidebarData }) => {
    return (
      <ul id="side-menu">
        {sidebarData.map((section, index) => (
          <React.Fragment key={index}>
            <li className="menu-title">{section.parent}</li>
            {section.menu.map((item, itemIndex) => (
              <li key={itemIndex}>
                {item.toggle ? (
                  <a href={item.url} data-toggle="collapse">
                    <FeatherIcon icon={item.icon} />
                    {item.badge.visible && (
                      <span className={`badge ${item.badge.class} badge-pill float-right`}>
                        {item.badge.value}
                      </span>
                    )}
                    <span>{item.name}</span>
                  </a>
                ) : (
                  <a href={item.url}>
                    <FeatherIcon icon={item.icon} />
                    <span>{item.name}</span>
                  </a>
                )}

                {item.submenu.length > 0 && (
                  <div className={`collapse ${item.toggle ? 'show' : ''}`} id={`sidebar${item.name}`}>
                    <ul className="nav-second-level">
                      {item.submenu.map((subItem, subIndex) => (
                        <li key={subIndex}>
                          <a href={subItem.url}>{subItem.name}</a>
                        </li>
                      ))}
                    </ul>
                  </div>
                )}
              </li>
            ))}
          </React.Fragment>
        ))}
      </ul>
    );
  };
const LeftSidebar = () => {

    const leftSidebarItem: SidebarSection[] = sidebarData;

    console.log(leftSidebarItem);

  return (
    <div className="left-side-menu">

                <div className="h-100" data-simplebar>

                    {/*  User box  */}
                    <div className="user-box text-center">
                        <img src="../assets/images/users/user-1.jpg" alt="user-img" title="Mat Helme"
                            className="rounded-circle avatar-md" />
                        <div className="dropdown">
                            <a href="javascript: void(0);" className="text-dark dropdown-toggle h5 mt-2 mb-1 d-block"
                                data-toggle="dropdown">Geneva Kennedy</a>
                            <div className="dropdown-menu user-pro-dropdown">

                                {/*  item */}
                                <a href="javascript:void(0);" className="dropdown-item notify-item">
                                    <i className="fe-user mr-1"></i>
                                    <span>My Account</span>
                                </a>

                                {/*  item */}
                                <a href="javascript:void(0);" className="dropdown-item notify-item">
                                    <i className="fe-settings mr-1"></i>
                                    <span>Settings</span>
                                </a>

                                {/*  item */}
                                <a href="javascript:void(0);" className="dropdown-item notify-item">
                                    <i className="fe-lock mr-1"></i>
                                    <span>Lock Screen</span>
                                </a>

                                {/*  item */}
                                <a href="javascript:void(0);" className="dropdown-item notify-item">
                                    <i className="fe-log-out mr-1"></i>
                                    <span>Logout</span>
                                </a>

                            </div>
                        </div>
                        <p className="text-muted">Admin Head</p>
                    </div>

                    {/* Sidemenu */}
                    <div id="sidebar-menu">

                        <SidebarMenu sidebarData={leftSidebarItem} />

                    </div>
                    {/* End Sidebar */}

                    <div className="clearfix"></div>

                </div>
                {/* Sidebar -left */}

            </div>
  )
}

export default LeftSidebar
